//SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.4;

import "./DataUtils.sol";

// Similar to multicall, this contract aggregates multiple function calls into one.
contract DataAggregator {
    address owner;
    address utils;

    constructor (address _utils) {
        owner = msg.sender;
        utils = _utils;
    }

    // Allow the owner to change the utils contract address.
    function setUtilsAddress (address _utils) external {
        require (msg.sender == owner);
        utils = _utils;
    }

    // Given a pair address, return metadata for both tokens in the pair.
    function getPairMetadata (address pairAddress) external view returns (
        address factory_address,
        address token0_address, 
        string memory token0_name, 
        string memory token0_symbol, 
        uint8 token0_decimals, 
        address token1_address, 
        string memory token1_name, 
        string memory token1_symbol, 
        uint8 token1_decimals) 
    {
        (, bytes memory d_fac) = pairAddress.staticcall(abi.encodeWithSignature("factory()"));
        (, bytes memory d_t0_addr) = pairAddress.staticcall(abi.encodeWithSignature("token0()"));
        (, bytes memory d_t1_addr) = pairAddress.staticcall(abi.encodeWithSignature("token1()"));

        factory_address = abi.decode(d_fac, (address));
        token0_address = abi.decode(d_t0_addr, (address));
        token1_address = abi.decode(d_t1_addr, (address));

        (token0_name, token0_symbol, token0_decimals) = getTokenMetadata(token0_address);
        (token1_name, token1_symbol, token1_decimals) = getTokenMetadata(token1_address);
    }

    function getTokenMetadata (address tokenAddress) private view returns (
        string memory token_name,
        string memory token_symbol,
        uint8 token_decimals)
    {
        (, bytes memory name) = tokenAddress.staticcall(abi.encodeWithSignature("name()"));
        (, bytes memory symbol) = tokenAddress.staticcall(abi.encodeWithSignature("symbol()"));
        (, bytes memory decimals) = tokenAddress.staticcall(abi.encodeWithSignature("decimals()"));

        DataUtils dataUtils = DataUtils(utils);

        try dataUtils.decodeBytesAsString(name) returns (string memory s) {
            token_name = s;
        } catch (bytes memory) {
            token_name = dataUtils.bytes32ToString(dataUtils.decodeBytesAsBytes32(name));
        }

        try dataUtils.decodeBytesAsString(symbol) returns (string memory s) {
            token_symbol = s;
        } catch (bytes memory) {
            token_symbol = dataUtils.bytes32ToString(dataUtils.decodeBytesAsBytes32(symbol));
        }

        token_decimals = abi.decode(decimals, (uint8));
    }
}

